import React from 'react'
// import { Link } from 'react-router-dom';

const Report = (props) => {
    return ( 
        <div className="w3-container w3-margin-top">
        <div className="w3-round-xlarge w3-light-gray">
        <div className="w3-container w3-margin">
        <p style={{}}><u><b>Creative Genius</b></u></p>
        <div className="w3-container w3-cell-row">
        <div class="w3-cell">
        <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{width:'60px'}}/>
        </div>
        <p><button class="w3-button w3-round-xxlarge w3-grey w3-text-grey"><b>View Report</b></button></p>
        </div>
        </div>
        </div>
        </div> 
    );
}

export default Report;
